KARACHI, Aug 08 (APP):Federal Minister for Commerce Jam Kamal Khan on Thursday visited the Expo Centre Karachi to review the arrangements for FoodAg 2024.
Jam Kamal accompanied by officers of Commerce Ministry and the TDAP inspected arrangements made for the three day Exhibition which will be participated by over 1,000 delegates from 74 countries.
